import React from "react";
const series = [
  { id: 0, value: 10, label: "series A" },
  { id: 1, value: 15, label: "series B" },
  { id: 2, value: 20, label: "series C" },
];
const PaymentChannel = () => {
  return (
    <div>
      <PieChart
        series={[
          {
            data: series,
          },
        ]}
        width={400}
        height={200}
      />
    </div>
  );
};

export default PaymentChannel;
